script: |
  super -f text -I q11775.spq | sort > q11775.out

inputs:
  - name: q11775.spq
    data: |
      SELECT 28 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 BETWEEN + 1 AND + CAST ( - + col0 AS INTEGER );
  - name: tab2

outputs:
  - name: q11775.out
    data: |
      28
      28
      28
